import React from 'react';
import Cardlist from './Cardlist'
import Searchbox from './Searchbox';
import {
    friends
} from './friends';



const App = () => {
    return ( <
        div className = '' >
        <
        h1 > S UPER < /h1>

        <
        Searchbox / >

        <
        Cardlist friends = { friends }
        / > < /
        div >
    );
}

export default App;
